/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */
import type { DeployStatus } from '../models/DeployStatus';
import type { TrainingStatus } from '../models/TrainingStatus';
import type { TrainJob } from '../models/TrainJob';
import type { TrainRequest } from '../models/TrainRequest';
import type { CancelablePromise } from '../core/CancelablePromise';
import { request as __request } from '../core/request';

export class TrainService {

    /**
     * List Training Jobs
     * @returns TrainJob Successful Response
     * @throws ApiError
     */
    public static listTrainingJobsTrainGet(): CancelablePromise<Array<TrainJob>> {
        return __request({
            method: 'GET',
            path: `/train`,
        });
    }

    /**
     * Train Model
     * @param requestBody
     * @param nSteps
     * @returns TrainJob Successful Response
     * @throws ApiError
     */
    public static trainModelTrainPost(
        requestBody: TrainRequest,
        nSteps: number = 4000,
    ): CancelablePromise<TrainJob> {
        return __request({
            method: 'POST',
            path: `/train`,
            query: {
                'n_steps': nSteps,
            },
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Model Status
     * @param jobId
     * @returns TrainingStatus Successful Response
     * @throws ApiError
     */
    public static modelStatusTrainJobIdStatusGet(
        jobId: string,
    ): CancelablePromise<TrainingStatus> {
        return __request({
            method: 'GET',
            path: `/train/${jobId}/status`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Model Deploy
     * @param jobId
     * @returns DeployStatus Successful Response
     * @throws ApiError
     */
    public static modelDeployTrainJobIdDeployGet(
        jobId: string,
    ): CancelablePromise<DeployStatus> {
        return __request({
            method: 'GET',
            path: `/train/${jobId}/deploy`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

}
